import React from 'react';

export default function Internships() {
  const items = [
    {role: 'Front-End Development', org: 'Micro IIT', date: 'Mar 2025 - Apr 2025'},
    {role: 'Web Full Stack Developer', org: 'EduSkills Academy', date: 'Jan 2025 - Mar 2025'},
    {role: 'AI & ML Trainee', org: 'APSSDC / Edunet Foundation', date: 'May 2024 - Jun 2024'},
  ];
  return (
    <section className="my-8">
      <h2 className="text-2xl font-semibold mb-3">Internships</h2>
      <div className="grid md:grid-cols-3 gap-4">
        {items.map(i => (
          <div className="card" key={i.role}>
            <h3 className="font-semibold">{i.role}</h3>
            <p className="text-sm">{i.org}</p>
            <p className="mt-2 text-xs">{i.date}</p>
          </div>
        ))}
      </div>
    </section>
  );
}
